import $ from 'jquery';
import { callbackify } from 'util';
$(document).ready(function () {

    if($('.sidenav---sidenav-toggle---1KRjR').attr("expanded") == "true"){
        $('.sidenav---sidenav-toggle---1KRjR').click(function(){
            $('.sc-bdVaJa').animate({
                width: "calc(100%-64px)"
            }, 300);
        }); 
    }

});
